import React from 'react';
import backgroundImage from '../images/Trading.png';

function Trading() {
    return (
        <section className="relative bg-center bg-no-repeat bg-cover h-[93vh]" style={{backgroundImage: `url(${backgroundImage})`}}>
            <div className="bg-black bg-opacity-60 h-full flex items-center">
                <div className="px-4 mx-auto max-w-screen-xl text-left py-32">
                    <div className='max-w-2xl'>
                        <h3 className='text-yellow-400 text-2xl font-mono font-extrabold mb-2'>- Trading</h3>
                        <h1 className="mb-4 text-5xl md:text-6xl lg:text-7xl font-extrabold leading-none tracking-tight text-white mt-4">
                            Get back to <span className='underline underline-offset-[10px] decoration-green-500'>growth</span> with our <span className="text-red-500">#1 Trading</span> services.
                        </h1>
                        <p className="text-lg lg:text-xl text-gray-300 mt-8">
                            Our mission is to provide high-quality and cost-effective solutions for the transportation of goods and oil products across the Black and Caspian seas. We aim to deliver value to our customers, partners, and employees through our professionalism, integrity, and innovation.
                        </p>
                    </div>
                </div>
            </div>
        </section>
    );
}

export default Trading;
